import React from 'react';
import { useParams } from 'react-router-dom';
import MatchDetailTabs from './MatchDetailTabs';

export default function MatchDetail() {
  const { id } = useParams();
  return (
    <div>
      <h1>Match Detail</h1>
      <MatchDetailTabs matchId={id} />
    </div>
  );
}
